import react from "react";

function Register() {
    return (
      <div>
        <input type="text" placeholder="Enter your Roll no." />
        <input type="text" placeholder="Enter your Name"/>
        <input type="text" placeholder="Enter your Password"/>
        <div>
          <p>On Submit</p>
        </div>
      </div>
    );
  }

  export default Register;
